{
  "ubx_message": {
    "name": "UBX-CFG-LOGFILTER",
    "class_id": "0x06",
    "message_id": "0x47",
    "message_type": "get_set",
    "payload_length": {
      "fixed": 12
    },
    "payload_fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "version",
        "description": "Message version (0x01 for this version)",
        "fixed_value": 1
      },
      {
        "byte_offset": 1,
        "data_type": "X1",
        "name": "flags",
        "description": "Flags",
        "sub_fields": [
          {
            "bit_offset": 0,
            "bit_length": 1,
            "data_type": "U1",
            "name": "recordEnabled",
            "description": "1 = enable recording, 0 = disable recording"
          },
          {
            "bit_offset": 1,
            "bit_length": 1,
            "data_type": "U1",
            "name": "psmOncePerWakupEnabled",
            "description": "1 = enable recording only one single position per PSM on/off mode wake-up period, 0 = disable once per wake-up"
          },
          {
            "bit_offset": 2,
            "bit_length": 1,
            "data_type": "U1",
            "name": "applyAllFilterSettings",
            "description": "1 = apply all filter settings, 0 = only apply recordEnabled"
          }
        ]
      },
      {
        "byte_offset": 2,
        "data_type": "U2",
        "name": "minInterval",
        "scale": "raw",
        "unit": "S",
        "description": "Minimum time interval between logged positions (0 = not set). This is only applied in combination with the speed and/or position thresholds. If both minInterval and timeThreshold are set, minInterval must be less than or equal to timeThreshold."
      },
      {
        "byte_offset": 4,
        "data_type": "U2",
        "name": "timeThreshold",
        "scale": "raw",
        "unit": "S",
        "description": "If the time difference is greater than the threshold, then the position is logged (0 = not set)."
      },
      {
        "byte_offset": 6,
        "data_type": "U2",
        "name": "speedThreshold",
        "scale": "raw",
        "unit": "m/s",
        "description": "If the current speed is greater than the threshold, then the position is logged (0 = not set). minInterval also applies."
      },
      {
        "byte_offset": 8,
        "data_type": "U4",
        "name": "positionThreshold",
        "scale": "raw",
        "unit": "m",
        "description": "If the 3D position difference is greater than the threshold, then the position is logged (0 = not set). minInterval also applies."
      }
    ]
  }
}
